import React from "react";

const SideNavbar = ({ setInputType }) => {
  return (
    <div className="flex flex-col gap-16 p-2">
      <div
        className="cursor-pointer p-3 bg-[#f8a100] rounded-md"
        onClick={() => setInputType("about")}
      >
        About
      </div>
      <div
        className="cursor-pointer p-3 bg-[#f8a100] rounded-md"
        onClick={() => setInputType("education")}
      >
        Education
      </div>
      <div
        className="cursor-pointer p-3 bg-[#f8a100] rounded-md"
        onClick={() => setInputType("experience")}
      >
        Experience
      </div>
      <div
        className="cursor-pointer p-3 bg-[#f8a100] rounded-md"
        onClick={() => setInputType("projects")}
      >
        Projects
      </div>
    </div>
  );
};

export default SideNavbar;
